import React from 'react';

export default function Sort() {
  return (
        <div className="flex flex-row-reverse sm:text-end mt-2 sm:mt-0 sm:ml-4 md:mx-6 sm:py-2">
             <div class="mt-4">
                    <select class="focus:ring-purple-400 focus:border-purple-400 w-full p-2 rounded-md">
                        <option value="">---為您精選---</option>
                        <option value="1">價格由高到低</option>
                        <option value="2">價格由低到高</option>
                        <option value="3">評分由高到低</option>
                        <option value="4">評分由低到高</option>
                    </select>
                </div>
        </div>

  );
}
